import Util from './util/util.js';
import VuiBase from './base/base.vue';
import createComponent from './util/create-component.js';
import generateComponents from './util/generate-components.js';

const context = require.context('./components', true, /\.vue$/);

const components = generateComponents(context); //console.log(components);

export { components, Util, VuiBase, createComponent };
export default components;

import { createApp, h } from 'vue';

const createComponent = function (props, slots, container) {
  const Component = this;

  if (typeof slots === 'function') {
    slots = slots.call(this, h);
  } // full signature
  // function h(
  //  type: string | Component,
  //  props?: object | null,
  //  children?: Children | Slot | Slots
  // ): VNode


  const app = createApp({
    setup() {
      return () => h(Component, props, slots);
    }

  }); // instance proxy

  let instance;

  if (container) {
    instance = app.mount(container);
  } else {
    const temp = document.createElement('div');
    document.body.appendChild(temp);
    instance = app.mount(temp);
    document.body.appendChild(instance.$el);
    temp.remove();
  } // console.log(instance);
  //console.log('app', app);


  return app;
};

export default createComponent;

import createComponent from './create-component.js';
export default function (context) {
  const components = {};
  const paths = context.keys(); //console.log(paths);

  paths.forEach(path => {
    //console.log(path);
    //get folder name
    //kebab case, custom element names must contain a hyphen.
    const list = path.toLowerCase().split('/'); //file and folder should be same

    const fileName = list.pop();
    const folderName = list.pop(); // "./vui-button/vui-button.vue" 
    // entry file name must be same with folder name

    if (fileName !== "".concat(folderName, ".vue")) {
      //console.log(`ignore ${path}`);
      return;
    }

    const N = folderName.slice(0, 1).toUpperCase() + folderName.slice(1).toLowerCase();
    const componentName = "Vui".concat(N); //esModule default

    const Component = context(path).default; //console.log(context(path));

    Component.createComponent = createComponent; // no private component

    if (Component.private) {
      return;
    }

    components[componentName] = Component;
  }); //console.log(components);

  return components;
}

export const isInvalid = function (data) {
  if (typeof data === 'undefined' || data === null) {
    return true;
  }

  return false;
};
export const toNum = function (num, toInt) {
  if (typeof num !== 'number') {
    num = parseFloat(num);
  }

  if (isNaN(num)) {
    num = 0;
  }

  if (toInt) {
    num = Math.round(num);
  }

  return num;
};
export const isList = function (data) {
  if (data && data instanceof Array && data.length > 0) {
    return true;
  }

  return false;
};
export const toList = function (data) {
  if (typeof data === 'undefined') {
    return [];
  }

  if (data instanceof Array) {
    return data;
  }

  return [data];
};
export const token = function (len) {
  let pre = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : '';
  let str = Math.random().toString().substr(2);

  if (len) {
    str = str.substr(0, toNum(len));
  }

  return pre + str;
};
export const hasOwn = function (obj, key) {
  if (!obj) {
    return false;
  }

  return Object.prototype.hasOwnProperty.call(obj, key);
};
export const getValue = function (data, dotPathStr, defaultValue) {
  if (!dotPathStr) {
    return defaultValue;
  }

  let current = data;
  const list = dotPathStr.split('.');
  const lastKey = list.pop();

  while (current && list.length) {
    const item = list.shift();
    current = current[item];
  }

  if (current && hasOwn(current, lastKey)) {
    const value = current[lastKey];

    if (typeof value !== 'undefined') {
      return value;
    }
  }

  return defaultValue;
};
export const clamp = function (value, min, max) {
  return Math.max(min, Math.min(max, value));
};
export default {
  isInvalid,
  toNum,
  isList,
  toList,
  token,
  getValue,
  clamp
};

import BaseRender from './base-render.vue';
export default {
  components: {
    BaseRender
  },
  props: {
    modelValue: {
      type: [String, Boolean, Number, Object],
      default: null
    },
    value: {
      type: String,
      default: ''
    },
    label: {
      type: String,
      default: ''
    },
    title: {
      type: String,
      default: ''
    },
    visible: {
      type: Boolean,
      default: true
    },
    disabled: {
      type: Boolean,
      default: false
    }
  },

  data() {
    return {
      dataVisible: this.visible,
      //bridge from parent and child v-model: moduleValue
      dataModelValue: this.modelValue
    };
  },

  watch: {
    //from parent changed props
    modelValue: function (nv) {
      //this.log('modelValue changed:', nv);
      this.dataModelValue = nv;
    },
    //from child changed value
    dataModelValue: function (nv) {
      //this.log('dataModelValue changed:', nv);
      this.$emit('update:modelValue', nv);
    },
    visible: function (nv) {
      this.dataVisible = nv;
    }
  },

  created() {
    this.uid = this._.uid;
    this.cid = this.getComponentId(); //console.log(this.cid);
  },

  methods: {
    log() {
      const args = Array.from(arguments);
      args.unshift(this.cid);
      console.log.apply(console, args);
    },

    destroy() {
      //this.log('destroy app NOT component');
      this.$.appContext.app.unmount();
    },

    getComponentId() {
      const ls = ['vui'];
      const cn = this.$options.name;

      if (cn) {
        ls.push("".concat(cn).toLowerCase());
      } else {
        console.error('Invalid component name', this);
      }

      ls.push(this.uid);
      return ls.join('-');
    },

    getSlot(name) {
      const fun = this.$slots[name];

      if (!fun) {
        return;
      }

      let ls = fun(); //console.log(ls);

      ls = ls.filter(it => it.type); //console.log(ls);

      return ls;
    },

    getList() {
      const l = arguments.length;
      let i = 0;

      while (i < l) {
        const item = arguments[i];

        if (Array.isArray(item)) {
          return item;
        }

        i++;
      }

      return [];
    }

  }
};

